import React from 'react';

interface TitlePaginationProps {
  selected: boolean;
  onClick?: () => void;
}
const TitlePagination: React.FC<TitlePaginationProps> = (props) => {
  const {selected} = props;
  const styles = {
    dot: {
      cursor: 'pointer',
      height: '10px',
      width: '10px',
      margin: '6vh 2vh 0 2vh',
      backgroundColor: '#bbb',
      borderRadius: '50%',
      display: 'inline-block',
      transition: 'backgroundColor 0.6s ease',
    },
    activeDot: {
      cursor: 'pointer',
      height: '10px',
      width: '10px',
      margin: '5vh 2vh',
      backgroundColor: '#000',
      borderRadius: '50%',
      display: 'inline-block',
      transition: 'backgroundColor 0.6s ease',
    },
  };
  return (
    <div style={selected? styles.activeDot : styles.dot}/>
  );
};

export default TitlePagination;
